import * as React from 'react';
import { StyleSheet } from 'react-native';
import MainLayout from '../components/MainLayout';

import { Text, View } from '../components/Themed';

export default function AnnualScreen() {

    var content = [];
    for (let i = 0; i < 5; i++) {
        content.push(<Text >Tab {i}</Text>);
        content.push(<View style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />);
    }
    return (
        <MainLayout title="Perennials" >
            {content}
        </MainLayout >
    );
}

const styles = StyleSheet.create({

    separator: {
        marginVertical: 30,
        height: 1,
        width: '80%',
    },
});
